import React from 'react';
import { Header, Icon, Player, Embed, Segment, Button } from 'semantic-ui-react';
import Vikings from '../Video/Vikings.mp4';
import Got from '../Video/got.mp4';


const HeaderPart = () => {
    return (
        <React.Fragment>
            <Segment placeholder>
                <video
                    autoPlay
                    loop
                    muted
                    style={{
                         position: "absolute",
                         width:"100%",
                         top: "50%",
                         left:"50%",
                         height: "100%",
                         objectFit: "cover",
                        transform: "translate(-50%,-10%)"
                    }}
                >
                    <source src={Vikings} type="video/mp4" />
                </video>
            </Segment>
            <div>dsfsdfsdfsd</div>
        </React.Fragment>
    )
}

export default HeaderPart;
